import React, { Component } from "react";
import _ from "lodash";
class ListGroup extends React.Component {
  render() {
    const { genreCount, genreName } = this.props;
    const allGenre = _(genreName);

    return (
      <div>
        <ul className="list-group">{console.log(allGenre)}</ul>
      </div>
    );
  }
}

export default ListGroup;
